import React from "react";
import Layout from "../components/Layout";
import styled from "styled-components";

function Post() {
	return (
		<Layout>
			<InputContainer>
				<input></input>
				<input></input>
				<input></input>
			</InputContainer>
		</Layout>
	);
}

export default Post;

const InputContainer = styled.div`
	display: flex;
	/* align-items: center; */
	justify-content: left;
	flex-direction: column;
`;
